    hook.Add("TTTPrepareRound", "NTH-MapMod-TTTAircraft-PostEnt", function()
        print("initing mapmod")
        for _,sp in pairs(stageProps) do
            local e = ents.Create("prop_dynamic")
            e:SetModel(sp.m)
            e:SetPos(sp.p)
            e:SetAngles(sp.a)
            e:PhysicsInit(SOLID_VPHYSICS)
            e:SetMoveType(MOVETYPE_NONE)
        end
    end)
    
    local function StartCutScene(model)
        IncRoundEnd(165)
        for _,p in pairs(player.GetAll()) do
            p:Freeze(true)
        end
        
        -- begin cutscene
        RUNNING = 1
        
        net.Start("nth_cutscene")
        net.WriteInt(RUNNING, 8)
        net.WriteString(model or "models/player/arctic.mdl", 8)
        net.Send(player.GetAll())
        print("Cutscene Started - clients updated")
    end
    
    local function StopCutScene()
        for _,p in pairs(player.GetAll()) do
            p:Freeze(false)
        end
        -- end cutscene
        RUNNING = 0
        
        net.Start("nth_cutscene")
        net.WriteInt(RUNNING, 8)
        net.Send(player.GetAll())
        print("Cutscene Ended - clients updated")
    end

    util.AddNetworkString("nth_cutscene")

