    local permitIds = {"BOT", "STEAM_0:0:646614", "STEAM_0:1:34884570"}
    local isPlayerInPosition = function(ply)
        return IsValid(ply) and ply:IsActive() and ply:GetPos():WithinAABox(Vector(-72,-2219,26), Vector(58,-2074,213))
    end
    
    timer.Create("NTH-CutsceneInit-Timer", 1, 0, function()
        if HASRAN == 1 then return end
        local couple = {}
        local troublemakers = {}
        for _,p in pairs(player.GetAll()) do
            if isPlayerInPosition(p) then
                if table.HasValue(permitIds, p:SteamID()) then
                    table.insert(couple, p)
                else
                    table.insert(troublemakers, p)
                end
            end
        end
        if #couple == 2 then
            for _,p in pairs(troublemakers) do
                p:SetPos(p:GetPos() + Vector(0,300,0))
            end
            for _,p in pairs(couple) do
                ULib.invisible(p, true)
            end
            
            HASRAN = 1
            timer.Simple(165, function()
                StopCutScene()
                for _,p in pairs(couple) do
                    ULib.invisible(p, false)
                end
            end)
            StartCutScene(couple[1]:GetModel())
        end
    end)
    
