    net.Receive("nth_cutscene", function()
        RUNNING = net.ReadInt(8)
        local CharModel = net.ReadString()

        SMP.StopPlayback()
        SMP.DestroyScene()
        if RUNNING == 1 then

            local scenes = {}
            if #scenes < #rawScenes then
                for i = 1, #rawScenes do
                    table.insert(scenes, table.Copy(util.JSONToTable(rawScenes[i])))
                end
            end

            SMP.Setup({
                modelLookup = {
                    ['leet.mdl']    ={mdl=CharModel, typ="rag"},
                    ['arctic.mdl']  ={mdl=CharModel, typ="rag"},
                    ['camera.mdl']  ={mdl='models/props_junk/watermelon01.mdl', typ="prop", camera=true},
                },
                audioTrack = 'nth/map_mods/aircraft-fly.mp3',
                renderFx = renderFx
            })
            for _,scene in ipairs(scenes) do
                SMP.AddScene(scene)
            end
            SMP.StartPlayback()
        end
    end)
    
